    false,nt"url": null,nt"notes": "The Southeast Fisheries Science Center
    Mississippi Laboratories conducts standardized fisheries independent resource surveys
    in the Gulf of Mexico, South Atlantic, and U.S. Caribbean to provide abundance and
    distribution information to support regional and international stock assessments.
    Environmental profiles are acquired during all surveys and are averaged into one
    meter depth bins. The data are acquired with Sea-Bird SBE25 and SBE9 profilers equipped
    with water temperature, conductivity, dissolved oxygen, beam transmittance, and
    fluorescence sensors. These are raw data that are unprocessed.",nt"owner_org":
